/**
 * roles当前用户权限，route 判断该路径用户是否有权访问
 * @param roles
 * @param route
 */
function hasPermission(roles, route) {
  if (route.meta && route.meta.roles) {
    return roles.some(role => route.meta.roles.indexOf(role) != -1);
  } else {
    return true;
  }
}

